import React from "react";
import { useNavigate } from "react-router-dom";
import "./SummaryCard.css"; // Add your styles here
import Navbar from "./Navbar"; // Assuming you have a Navbar component

const TravelSummaryCard = ({ date, itemCount, coverImage, onClick }) => {
  return (
    <div className="summary-card" onClick={onClick}>
      <div className="summary-left">
        <div className="summary-date">{date}</div>
        <div className="summary-count">{itemCount} items</div>
      </div>
      <div className="summary-right">
        <img
          src={coverImage || "/images/default-cover.jpg"}
          alt="cover"
          className="summary-cover"
        />
      </div>
    </div>
  );
};

export default function TravelSummaries({ summaries }) {
  const navigate = useNavigate();

  return (
    <>
    <Navbar/>
    <div className="summary-wrapper">
      <h2 className="summary-title">üåê My Travel Summaries</h2>
      {summaries.map((summary, index) => (
        <TravelSummaryCard
          key={index}
          date={summary.date}
          itemCount={summary.items.length}
          coverImage={summary.cover}
          onClick={() => navigate(`/summary/${summary.date}`)}
        />
      ))}
    </div>
    </>
  );
}
